import React from 'react';
import ReactDOM from 'react-dom';
// import './index.css';
import Box from './Box';


class App extends React.Component {

  render(){
    return (
      <div>
         {this.state.shouldRemoveBox ? null : (
          <div>
            <Box size = "50px"/>
            <Box size = "140px"/>
            <Box size = "100px"/>
        </div>)}
      </div>
       );

  }
}

ReactDOM.render(<App />, document.querySelector('#root'));
